script: |
  super -f text -I q11521.spq | sort > q11521.out

inputs:
  - name: q11521.spq
    data: |
      SELECT DISTINCT cor1.col0 + + 80 / - cor0.col0 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q11521.out
    data: |
      -4
      6
      67
      68
      77
      78
